import YouImg from "./images/youtube.svg";
import XtwImg from "./images/youtube.svg";
import FaceImg from "./images/youtube.svg";
import InstImg from "./images/youtube.svg";

const Footer = () => {
  return (
    <>
      <div className="container-fluid my-5 py-5">
        <div className="mx-auto p-2" style={{ width: "200px" }}>
          <div className="row">
            <a class="col nav-link" href="#"><img src={YouImg} alt="See More" style={{ width: "30px", height: "30px" }} /></a>
            <a class="col nav-link" href="#"><img src={XtwImg} alt="See More" style={{ width: "30px", height: "30px" }} /></a>
            <a class="col nav-link" href="#"><img src={YouImg} alt="See More" style={{ width: "30px", height: "30px" }} /></a>
            <a class="col nav-link" href="#"><img src={YouImg} alt="See More" style={{ width: "30px", height: "30px" }} /></a>
          </div>
          Centered element
        </div>
      </div>
    </>
  );
};

export default Footer;
